import React from 'react';
import { Routes, Route } from 'react-router-dom';
import HomeLayout from './components/homelayout.jsx';
import MainLayout from './components/mainlayout.jsx';
import About from './components/About.jsx';

function App() {
  return (
    <Routes>
      <Route path="/" element={<HomeLayout />} />
      <Route path="/services" element={<MainLayout />} />
      <Route path="/dashboard" element={<MainLayout />} />
      <Route path="/tourists" element={<MainLayout />} />
      <Route path="/incidents" element={<MainLayout />} />
      <Route path="/reports-analytics" element={<MainLayout />} />
      <Route path="/help-support" element={<MainLayout />} />
      <Route path="/map-geo-fencing" element={<MainLayout />} />
      <Route path="/settings-admin" element={<MainLayout />} />
      <Route path="/profile" element={<MainLayout />} />
      <Route path="/about" element={<About />} />
      <Route path="/contact" element={<MainLayout />} />
      <Route path="/login" element={<MainLayout />} />
    </Routes>
  );
}

export default App;
